function Header() {

    return(
        <>
        <div className='border sticky top-0 z-30 px-3 opacity-75 bg-white py-3 shadow grid grid-cols-2'>
            <p>UBD HEP Counseling</p>
            <ul className='list-none flex flex-row justify-end space-x-3 font-sans'>
                <li><a href="#">Home</a></li>
                <li><a href="#">Services</a></li>
                <li><a href="#">Counselor</a></li>
                <li><a href="#">Login</a></li>
                
            </ul>
        </div>
        </>
    )

}

export default Header;
